  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Medicare Health Outcomes Survey (HOS)
  identifiable data files are comprised of the entire national sample for a given
  2-year cohort (including both respondents and non-respondents), and contain all
  of the HOS survey items. The HOS identifiable data files include Medicare health
  plan identifiers, as well as several additional variables describing plan characteristics.
  The identifiable data files contain protected beneficiary-level health information
  such as date of birth.  These files also contain specific direct person identifiers
  (i.e. name and health insurance claim number) that are not included in the HOS limited
  data sets.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
